import React from 'react';
import Img from '../../images/movie.jpg';
import { MovieImg,
         MovieContainer,
         MovieWrapper,
         DetWrapper,
         MovieName 
        
        } from './movieelements';

function movie() {
    return (


        <div>
          <MovieContainer>
          <MovieWrapper>
             <MovieImg className="profileuserimg"
                             src={Img}
                             alt=""/>
       </MovieWrapper>

       <DetWrapper>
          <MovieName>
                  Spider Man
          </MovieName>
       </DetWrapper>
         </MovieContainer>
            
        </div>
    )
}

export default movie
